import React, {useState, useEffect} from 'react'
import axios from 'axios'
import './App.css';



function App() {
  const [coins, setCoins] = useState([]);
  const [search, setSearch] = useState('')

  useEffect(() => {
    axios.get('https://api.coingecko.com/api/v3/coins/markets?vs_currency=rub&order=market_cap_desc&per_page=100&page=1&sparkline=false')
    .then(res => {
      setCoins(res.data)
      console.log(res.data)
    }).catch(error => alert('Gde to oshibka epta'))
  }, []);

  const handleChange = e => {
    setSearch(e.target.value)
  }

  return (
    <div className="coin-app">
      <div className="coin-search">
        <h1 className="coin-text"> Поиск крипты</h1>
        <form>
          <input type="text" placeholder="Поиск" className="coin-input" onChange={handleChange}/>
        </form>
      </div>
    </div>
  );
}

export default App;
